message:
As 04 Fases:

1* Fase é a do combate:
O povo vai para frente das FA;

2* Fase: o povo não aceita mais os desinformantes, onde ninguém engana mais o povo;

3* Fase: são aqueles que já estão de prontidão para o combate, e está ali porque quer. É nesse momento que se cria o espírito de corpo. Todos nós somos combatentes. Não há momento para terminar, há momento para a vitória;

4* Fase: não tenham pena! A corrupção mata, as ideologias matam. Não tenham pena! Não existem inocentes nesta altura do campeonato.

INTRODUÇÃO:
1) O SISTEMA existe. A estrutura só é legítima se atua a favor do povo. Não é o que ocorre;

2) Para sobreviver ele precisa de oxigênio; 

3) O oxigênio é o dinheiro ($) que compra, corrompe e dá regalias aos que estão no topo;

4) O SISTEMA necessita de FLUXO CONTÍNUO de recursos ($) para manter-se;

5) O $ vem de nós, pagadores de impostos, consumidores de produtos e serviços. TUDO O QUE COMPRAMOS OU USAMOS supre o SISTEMA;

6) Cada um de nós alimenta o SISTEMA através de mecanismos que dependem de nós mesmos. Está no controle de cada um a vida desse sistema.

Não basta protestar nos quartéis. Precisamos ajudar de outro modo. 
QUEBRAR O SISTEMA de forma pacífica e pouco rastreável é a solução.

COMO QUEBRAR O SISTEMA:

7) 1) É necessário fazer um esforço IMEDIATO E CONSTANTE durante um prazo de tempo razoável (talvez meses);

8) Cidadão comum, assalariado, aposentado: reduza suas compras em mercados, lojas, supérfluos e utilização de serviços; compre ou use apenas o estritamente necessário (reduz ICMS - estados e ISS - municípios. Abasteça pouco, rode pouco (reduz a ICMS, ISS E CIDE combustíveis). Não viaje, cancele reservas e pacotes de férias (impacta empresas aéreas, bancos, turismo, vendas e serviços). Não pague impostos (IPTU, IRPF, etc);

9) Empresários e lojistas: fechem suas lojas durante 1 mês, dêem férias coletivas adiantadas, parem de recolher impostos;

10) trabalhadores de aplicativos e táxis: recolham seus veículos, deixem de trabalhar durante algumas semanas. Se precisarem trabalhar, façam operação tartaruga, dirijam em baixa velocidade, congestionem o trânsito;

11) transportes: trabalhem devagar e dirijam em baixa velocidade e congestionem as ruas e estradas;

12) caminhoneiros: se puderem, deixem seus caminhões em casa ou nas garagens e não trabalhem, vão para as manifestações ou ajudem quem está nelas. Se não puderem, dirijam devagar (40km/h), trabalhem devagar, carreguem e descarreguem devagar, estendam horários de almoço e de descanso;

13) servidores públicos: atendam e trabalhem devagar, com preciosismo e exatidão. Sejam rápidos apenas no que for realmente urgente.
